import icon from '../images/git-icon.png';

const Contact = () => {
    return ( 
        <div className="text-center" style={{height:'100%',minHeight:'100vh' }}>
            <h1>Contact</h1>
            <div >
              <div>
                <img src={icon} />
                GitHub

              </div>
              <div>
                
                Facebook
                
               </div>
               <div>
               
                Instagram

               </div>    
            </div>
        </div>
     );
}
 
export default Contact;
